// src/pages/YouthMinistry.js
import React from 'react';

const YouthMinistry = () => {
  return (
    <div>
      <h1>Youth Ministry</h1>
      <p>Welcome to the Youth Ministry.</p>
      <p>Known as the Victorious Youth of This Generation, it aims to transform the lives of young people and motivate them to succeed academically and spiritually.
      </p>
    </div>
  );
};

export default YouthMinistry;
